on_start = [
    lightning = (rnd 4 1)

    exectrigger $lightning
    exectrigger (+ $lightning 10)

    sleep (rnd 801 400) [
        exectrigger $lightning
        sleep (rnd 18001 2000) [ on_start ]
    ]

    sleep 2000 [
        exectrigger (+ $lightning 10)
    ]
]
